import React, { Component } from 'react';

class Footer extends Component {

	changeText(){
		console.log('changed')
	}

	render () {
		return (
			<React.Fragment>
			<h2 onClick={this.props.myAlert}> {this.props.trademark} </h2>
			<input type="text" onChange={this.changeText}/>
			</React.Fragment>
			)
	}

}

export default Footer;
